    //             .style("top", (d3.event.pageY - 28) + "px");
    //         })
    //     .on("mouseout", function(d) {
    //         div.transition()
    //             .duration(500)
    //             .style("opacity", 0);
    //     });


     svg.selectAll("dot")
        .data(nested)
    .enter().append("circle")
        .attr("r", 4)
        .attr("cx", function(d) { return xScale(d.values[0].time_converted); })
        .attr("cy", function(d) { return yScale(d.values[0].difference); })
        // .style("fill", function (d) { return COLOR_SCALE(d.type); })
        .style("fill", function (d) {return team_color_scale(d.values[0].team)})
        .style("opacity", 0.2)
        .on("mouseover", function(d) {
            let html_content = "";
            for (let i = 0; i < d.values.length; i++) {
                html_content += d.values[i].player_name + " | " + d.values[i].team + "<br/>" + d.values[i].action + " | "  + d.values[i].type + "<br/>"
            }
            div.transition()
                .duration(200)
                .style("opacity", .9)
                .style("background-color", team_color_scale(d.values[0].team));
            div	.html(html_content)
                .style("left", (d3.event.pageX) + "px")
                .style("top", (d3.event.pageY - 28) + "px");
            })
        .on("mouseout", function(d) {
            div.transition()
                .duration(500)
                .style("opacity", 0);
        });

    // Add axes
    let xAxis = d3.axisBottom(xScale);
    let yAxis = d3.axisLeft(yScale);

    svg.append("g")
        .attr("transform", "translate(0, 650)")
        .call(xAxis);

    svg.append("g")
        .attr("transform", "translate(50, 0)")
        .call(yAxis);

    // Axes Labels
    svg.append("text")
    .attr("x", 580)
    .attr("y", 690)
    .text("Game Time")
    .style("font-family", "monospace");

    svg.append("text")
    .attr("transform", "rotate(-90)")
    .attr("x", -280)
    .attr("y", 20)
    .text("Score")
    .style("font-family", "monospace");


    // Add line to show 0 score difference
    svg.append("line")
        .attr("x1", PADDING)
        .attr("y1", yScale(0))
        .attr("x2", WIDTH-PADDING)
        .attr("y2", yScale(0))
        .style("stroke", "grey");


    // Hard code positioning team names on the right side
    svg.append("text")
        .attr("x", PADDING + 10)
        .attr("y", PADDING + 10)
        .text(home_team)
        .style("font-family", "Inconsolata")
        .style("fill", team_color_scale(home_team));

    svg.append("text")
        .attr("x", PADDING + 10)
        .attr("y", HEIGHT - PADDING - 10)
        .text(away_team)
        .style("font-family", "Inconsolata")
        .style("fill", team_color_scale(away_team))


    console.log("DEBUG: exiting plotPlays");
    return null;
